import React from "react";
import "./Pages.css";

type SlideProps = {
  numberSlide: number;
  setNumberSlide: (number: number) => void;
};

const WhatIKnowPage: React.FC<SlideProps> = ({
  numberSlide,
  setNumberSlide,
}) => {
  return (
    <>
      <div className="slider-container header">
      <div className="wrapper">
      <h2 className="text-5xl my-8 text-center greeting font-medium ">
            What I Know
          </h2>
      </div>
      <div className="icons">
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(1)}
              >
                <i className="fa-solid fa-arrow-left"></i>&nbsp;My Way in Germany
              </button>
            </div>
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(4)}
              >
                My Softskills &nbsp;<i className="fa-solid fa-arrow-right"></i>
              </button>
            </div>
          </div>
      </div>
    </>
  );
};

export default WhatIKnowPage;
